import React from 'react'
import PropTypes from 'prop-types'


const Header = ({ title }) => {
    return (
        <header>
            <h1>{title}</h1>
        </header>
    )
}

Header.defaultProps = {
    title: 'Sha3raAir',
}

Header.propTypes = {
    title: PropTypes.string.isRequired,
}

export default Header
